import React from 'react';

const styles = {
    bar: {
        backgroundColor: 'white'
    },
    text: {
        color: 'white'
    }
}

const Sidebar = () => {

    return(

        <React.Fragment style={styles.bar}>
        <p style={styles.text}>sidebar</p>
        </React.Fragment>
    )
}
export default Sidebar
